import { makeStyles } from '@material-ui/core';
let green = "#219653";
let grey = "#e0e0e0";
export const useStyles = makeStyles(
  () => ({
    paper: {

    },
    grid: {
      backgroundColor: "#fff",
      border: "1px solid" + grey,
      borderRadius: 10,
      paddingLeft: 40,
      paddingRight: 40,
      width: 428,
      height: 566,
      textAlign: "center",
    },
    log: {
      width: 348,
      height: 56,
      border: "none",
      background: "#fafafa",
      borderRadius: "4px 4px 0px 0px",
    },
    pass: {
      width: 348,
      height: 56,
      border: "none",
      background: "#fafafa",
      borderRadius: "4px 4px 0px 0px",
    },
    SignIn: {
      background: green,
      border: 10 + "solid" + green,
    }
  }),
  { name: 'AuthPage' },
);
